  input: "\"TEXT\",\"F3XA\",\"\",\"This report is filed in response to the letter
    from the FEC dated September 19, 2007 requesting clarification on the following
    three items:    1.\tErrors on line 8: In March 2007 the committee converted from
    FEC File to vendor-supported services and software from NGP. In the conversion
    and training process, the year-to-date totals for these lines were not appropriately
    transferred to this report. This error is corrected with this filing.  2.\tThe
    MEMO items that appeared in error due to a training issue have been corrected.
    It belonged as part of a transaction on 4/30 in the prior month report and was
    misdated.  3.\tSchedule H4 was prepared in error for an event that was a 100%
    Federal fundraiser. This has been corrected in this and subsequent reports. An
    expenditure for the Wine 2007 fundraiser that was previously classified as Operating
    Expense has been re-classified as a joint fundraising expense to correct Sch.
    H4 as well.      Additionally, this report is filed to correct the Sch. H1 fixed
    allocation ratio for administrative expenses: The committee received inaccurate
    advise from commission staff and consultants at the close of 2006 as to the appropriate
    2007 fixed allocation ratio, and has applied the incorrect Non-Presidential and
    Non-Senate 15% fixed allocation ratio consistently since 1/1/2007.     Upon review
    and consultation with Commission staff, it is clear as pointed out by the Commission
    under 11 CFR 106.7(d)(2) and (3) that the appropriate fixed allocation ratio for
    these types of expenses for this committee in Nevada is Presidential Only Election
    Year 28% fixed allocation ratio.    This report amends the allocation items impacted
    by this global error. In this original report, the amount transferred from the
    non-federal to the allocation account was $604.43. The amount that should have
    been transferred based on this amended report is $812.00.    The committee will
    correct this underpayment by transferring $207.57 from the non-federal to the
    federal account on October 15, 2007.    This correction will also modify the ending
    cash totals that will be carried forward to the reports for the remainder of the
    year.          While reviewing this report utilizing the error-identification
    areas of the NGP software tool, additional minor corrections were made to this
    report to more accurately reflect the activities of the Committee during this
    reporting period.    \",\"\""
